import Button from "../components/buttons";

const Small = styled.button``;

const Container = styled.div`
  ${Small} {
    background-color: red;
  }
`;

function Nav() {
  return (
    <Container>
      <Button>Sports</Button>
      <Button>Roster</Button>
      <Button>Contact</Button>
    </Container>
  );
}

export default Nav;
